	('1e95d517-76be-4c70-8c0b-c68188ec6007', 'about', 'fr', ' propos d''InterMind', '**InterMind** a t dveloppe par Lukas Batschelet  l''Institut de gographie de l''Universit de Berne. L''application fait partie d''un travail de bachelor supervis par la prof. Dr Carolin Schurr et le Dr Moritz Gubler. Elle est utilise exclusivement  des fins de recherche scientifique pour tudier comment notre environnement immdiat influence le bien-tre momentan.

## Que signifie le bien-tre ?

Le bien-tre peut avoir de nombreuses significations. Il peut s''agir de quelque chose de durable  par exemple, de notre satisfaction gnrale dans la vie, de notre sant ou du sentiment de scurit et de soutien dans la vie quotidienne.

Dans cette tude, nous nous intressons principalement au **bien-tre momentan** : Comment vous sentez-vous ** cet instant prcis**,  cet endroit, dans cette situation ?

Le bien-tre est compris de manire holistique  il englobe des aspects **physiques** (par exemple fatigue, chaleur, calme) et des ressentis **psychiques** (par exemple satisfaction, scurit, appartenance). Ces impressions sont souvent phmres et dpendent fortement du lieu, de l''activit en cours et de la manire dont nous sommes perues.

## Pourquoi cette tude ?

La faon dont nous nous sentons dans un lieu dpend fortement de notre environnement. Certains lieux paraissent apaisants, familiers ou accueillants. D''autres peuvent provoquer un malaise ou un sentiment d''exclusion.

Mais ces expriences ne sont pas les mmes pour tout le monde. Elles peuvent dpendre de la manire dont nous sommes perues et traites  par exemple en fonction du genre, de l''origine, de la langue, de l''apparence ou d''autres caractristiques lies  notre position sociale.

Nous cherchons  comprendre comment diffrentes caractristiques  isoles ou combines  influencent le bien-tre momentan. Par exemple : Une jeune femme ayant une histoire migratoire ressent-elle un lieu public diffremment qu''un homme plus g au mme endroit et au mme moment ?

Cette tude explore pourquoi les lieux affectent les personnes diffremment. Elle vise  mieux comprendre comment se forment les sentiments d''appartenance, de scurit ou d''exclusion  et en quoi ils sont lis  la vie quotidienne, aux catgorisations sociales et aux conditions de vie personnelles.

## Comment se droule la participation ?

L''tude dure une semaine. Pendant cette priode, vous serez invite trois fois par jour  rpondre  une courte enqute sur votre smartphone. Chaque enqute porte sur :

* le lieu o vous vous trouvez  
* ce que vous y faites  
* ce que vous ressentez  
* et si vous vous y sentez  votre place ou non

Chaque enqute est disponible pendant une heure, puis elle expire automatiquement. Les moments sont rpartis de manire lgrement alatoire dans la journe.

Si vous manquez une enqute, ce n''est pas grave  vous pourrez simplement participer  la suivante.

