	('4d30df33-b516-4bc2-98d4-dac6390497af', 'privacy', 'en', 'Privacy Policy', 'InterMind is part of a scientific study conducted at the Institute of Geography, University of Bern. The app is used in the context of a Bachelor''s thesis by Lukas Batschelet, supervised by Prof. Dr. Carolin Schurr and Dr. Moritz Gubler.

This privacy policy explains what data is collected, how it is processed, and what rights you have as a participant.

## 1. Who is responsible?

The data controller is:

Institute of Geography  
University of Bern  
Hallerstrasse 12  
3012 Bern, Switzerland

