- Tes donnes sont stockes de manire anonyme sur un serveur scuris de la socit Supabase en Suisse.
- Aucun profil de dplacement ou historique de localisation consultable en permanence n''est enregistr.
- Tes donnes sont utilises exclusivement  des fins scientifiques et ne sont pas transmises  des tiers.

En cliquant sur "J''accepte", tu confirmes que tu as lu et compris ces informations et que tu participes volontairement  l''tude. Tu peux mettre fin  ta participation  tout moment et supprimer tes donnes via les paramtres de l''application.

Tu trouveras plus d''informations dans notre [Politique de confidentialit](https://intermind.ch/privacy-policy.html).', '2025-05-11 08:19:57.343919+00', '2025-05-11 08:19:57.343919+00');


