In dieser App wirst Du eine Woche lang drei Mal am Tag kurze Fragen zu deinem aktuellen Wohlbefinden und zu Deiner Umgebung beantworten.

Deine Antworten helfen uns dabei, besser zu verstehen, wie Menschen verschiedene Orte erleben  und wie diese Erfahrungen mit unterschiedlichen Lebenssituationen zusammenhngen.', NULL, '2025-05-11 08:17:57.175302+00', '2025-05-11 08:17:57.175302+00'),
	('2ecb4ab8-d06b-4af8-adb6-8144e9cbae5b', 'about_this_study', 'de', 'Worum geht es in dieser Studie?', 'Wie wir uns an einem Ort fhlen, hngt stark von unserer Umgebung ab. Manche Orte wirken beruhigend, vertraut oder einladend. Andere lassen uns unruhig werden, ausgegrenzt erscheinen oder fehl am Platz fhlen.

Solche Erfahrungen sind jedoch nicht fr alle Menschen gleich. Sie knnen davon abhngen, wie wir an einem Ort wahrgenommen und behandelt werden  zum Beispiel aufgrund von Geschlecht, Herkunft, Sprache, Aussehen oder anderen Merkmalen, die unsere gesellschaftliche Position prgen.

## Was meinen wir mit Wohlbefinden?

Wohlbefinden kann vieles bedeuten. Manchmal geht es dabei um etwas Langfristiges  zum Beispiel, wie zufrieden wir mit unserem Leben insgesamt sind, wie gesund wir uns fhlen oder ob wir uns sicher und untersttzt fhlen im Alltag.

In dieser Studie interessiert uns jedoch vor allem das **momentane Wohlbefinden**: Wie geht es Dir **jetzt gerade**, an diesem Ort, in dieser Situation?

Wohlbefinden ist dabei ganzheitlich zu verstehen  es umfasst sowohl **krperliche** Aspekte (z.B. Mdigkeit, Wrme, Ruhe), als auch **psychische** Empfindungen (z.B. Zufriedenheit, Sicherheit, Zugehrigkeit). Diese kurzfristigen Eindrcke sind oft flchtig und hngen stark davon ab, wo wir uns aufhalten, was wir gerade tun und wie wir dort wahrgenommen werden.

## Wer fhrt die Studie durch?

Die Studie ist Teil einer Bachelorarbeit am Geographischen Institut der Universitt Bern. Sie wird von Lukas Batschelet durchgefhrt und von Prof. Dr. Carolin Schurr und Dr. Moritz Gubler betreut.

## Was ist das Ziel dieser Studie?

Uns interessiert, wie sich verschiedene Merkmale  einzeln oder in Kombination  auf das momentane Wohlbefinden auswirken. Zum Beispiel: Fhlt sich eine junge Frau mit Migrationsgeschichte an einem ffentlichen Ort anders als ein lterer Mann, der sich zur gleichen Zeit am gleichen Ort aufhlt?

In der Studie gehen wir der Frage nach, warum Orte auf verschiedene Menschen unterschiedlich wirken. Wir wollen besser verstehen, wie Zugehrigkeit, Sicherheit oder ein Gefhl des Nicht-Dazugehrens entstehen  und wie diese Erfahrungen mit dem Alltag, sozialen Zuschreibungen und persnlichen Lebenslagen zusammenhngen.

## Wie luft die Teilnahme ab?

Die Studie dauert eine Woche. In dieser Zeit wirst Du dreimal tglich gebeten, eine kurze Befragung auf deinem Smartphone auszufllen. Dabei geht es jeweils um:

* den Ort, an dem Du dich gerade befindest
* was Du dort machst
* wie Du dich fhlst
* und ob Du dich dort zugehrig oder fremd erlebst

Jede Befragung ist jeweils fr eine Stunde verfgbar und verfllt danach automatisch. Die Zeitpunkte sind leicht zufllig ber den Tag verteilt, damit nicht immer zur gleichen Zeit und am gleichen Ort geantwortet wird.

Wenn Du eine Befragung verpasst, ist das kein Problem  Du kannst beim nchsten Zeitpunkt einfach wieder teilnehmen.', NULL, '2025-05-11 08:17:57.175302+00', '2025-05-11 08:17:57.175302+00'),
	('8d374499-1f9a-497c-a7be-34ba6f3952a6', 'consent', 'de', 'Einwilligung zur Teilnahme', 'Bevor Du mit der Befragung startest, bitten wir dich um deine Zustimmung zur Teilnahme an dieser Studie.

Die Teilnahme ist freiwillig.  
Du kannst einzelne Fragen berspringen (z.B. mit "Keine Angabe") und die Teilnahme jederzeit beenden.  
In den App-Einstellungen kannst Du deine Daten auch nachtrglich vollstndig lschen.

## Welche Daten werden erhoben?

- Angaben zu Deiner Person (z.B. Alter, Geschlecht, Bildung)
- Antworten zu Deinem aktuellen Befinden und deinem Aufenthaltsort
- Standortdaten, sofern Du die Freigabe erteilst

## Wie gehen wir mit Deinen Daten um?

- Wir speichern keine Namen, E-Mail-Adressen oder andere persnlichen Kontaktdaten
- Deine Daten werden anonymisiert auf einem gesicherten Server der Firma Supabase in der Schweiz gespeichert
- Es werden keine Bewegungsprofile oder dauerhaft abrufbaren Standortverlufe aufgezeichnet
- Deine Daten werden ausschliesslich fr wissenschaftliche Zwecke verwendet und nicht an Dritte weitergegeben

Mit "Ich stimme zu" besttigst Du, dass Du diese Informationen gelesen und verstanden hast und freiwillig an der Studie teilnimmst. Du kannst deine Teilnahme jederzeit beenden und deine Daten ber die App-Einstellungen lschen.

Weitere Informationen findest Du in unserer [Datenschutzrichtlinie](https://intermind.ch/privacy-policy.html).', NULL, '2025-05-11 08:17:57.175302+00', '2025-05-11 08:17:57.175302+00'),
	('00ad939f-568d-485e-a1c2-5fb899432e1f', 'notifications', 'de', 'Benachrichtigungen', 'Damit Du keine Befragung verpasst, senden wir Dir Benachrichtigungen.

Diese Erinnerungen kommen automatisch, wenn ein neuer Umfrageslot startet. Du hast dann jeweils eine Stunde Zeit, um zu antworten.

Die Benachrichtigungen sind wichtig, weil die Zeitfenster kurz sind. Du kannst sie in den Gerteeinstellungen abschalten  aber dann besteht die Gefahr, dass du Befragungen verpasst.

Wir empfehlen dir, Benachrichtigungen zuzulassen, damit du mglichst viele unterschiedliche Situationen erfassen kannst.', NULL, '2025-05-11 08:17:57.175302+00', '2025-05-11 08:17:57.175302+00'),
	('0aeec4fc-e91e-4a55-aed0-06ec064cbca1', 'location_acces', 'de', 'Standort', 'Damit wir die Antworten besser verstehen und rumliche Muster erkennen knnen, bitten wir Dich, die Standortfreigabe zu erlauben.

