	('6ba9e0e5-584d-469b-a246-95fb265ad74e', 'info_questions_about_you', 'de', 'Einige Fragen zu dir', 'Bevor wir mit den tglichen Befragungen starten, stellen wir Dir einmalig einige Fragen zu Dir selbst  zum Beispiel zu deinem Alter, Geschlecht, deiner Ausbildung und deiner Lebenssituation.

