	('f550c5dc-a9ee-4e05-bcce-62e83731cd45', 'welcome', 'fr', 'Bonjour !', 'Heureux-se de te voir ici !

Dans cette application, tu rpondras trois fois par jour pendant une semaine  de courtes questions sur ton bien-tre actuel et sur ton environnement.

Tes rponses nous aideront  mieux comprendre comment les gens vivent diffrents lieux - et comment ces expriences sont lies  diffrentes situations de vie.', NULL, '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('7e720dba-e294-446c-bac1-30fa34929cde', 'about_this_study', 'fr', 'Quel est l''objet de cette tude ?', 'La manire dont nous nous sentons dans un lieu dpend fortement de notre environnement. Certains lieux sont apaisants, familiers ou accueillants. D''autres nous mettent mal  l''aise, nous donnent l''impression d''tre exclus ou de ne pas tre  notre place.

De telles expriences ne sont toutefois pas identiques pour tout le monde. Elles peuvent dpendre de la manire dont nous sommes perus et traits dans un lieu - par exemple en raison de notre sexe, de notre origine, de notre langue, de notre apparence ou d''autres caractristiques qui dterminent notre position sociale.

## Qu''entendons-nous par bien-tre ?

Le bien-tre peut signifier beaucoup de choses. Parfois, il s''agit de quelque chose  long terme - par exemple,  quel point nous sommes satisfaits de notre vie en gnral,  quel point nous nous sentons en bonne sant ou si nous nous sentons en scurit et soutenus au quotidien.

Dans cette tude, nous nous intressons toutefois surtout au **bien-tre momentan** : Comment te sens-tu **en ce moment**,  cet endroit, dans cette situation ?

Le bien-tre doit tre compris de manire globale - il comprend aussi bien des aspects **corporels** (p. ex. fatigue, chaleur, calme) que des sensations **psychiques** (p. ex. satisfaction, scurit, appartenance). Ces impressions  court terme sont souvent fugaces et dpendent fortement de l''endroit o nous nous trouvons, de ce que nous sommes en train de faire et de la manire dont nous y sommes perus.

## Qui mne l''tude ?

L''tude fait partie d''un travail de bachelor  l''Institut de gographie de l''Universit de Berne. Elle est mene par Lukas Batschelet et encadre par le professeur Dr Carolin Schurr et le Dr Moritz Gubler.

## Quel est l''objectif de cette tude ?

Nous nous intressons  l''impact de diffrentes caractristiques - seules ou combines - sur le bien-tre momentan. Par exemple : une jeune femme issue de l''immigration se sent-elle diffrente dans un lieu public qu''un homme plus g qui se trouve au mme endroit au mme moment ?

Dans cette tude, nous nous penchons sur la question de savoir pourquoi les lieux ont un effet diffrent sur diffrentes personnes. Nous voulons mieux comprendre comment naissent l''appartenance, la scurit ou le sentiment de ne pas tre  sa place - et comment ces expriences sont lies au quotidien, aux attributions sociales et aux situations de vie personnelles.

## Comment se droule la participation ?

L''tude dure une semaine. Pendant cette priode, on te demandera trois fois par jour de remplir un bref questionnaire sur ton smartphone. Il s''agit  chaque fois de

* de l''endroit o tu te trouves actuellement
* ce que tu y fais
* comment tu te sens
* et si tu t''y sens  ta place ou non.

Chaque enqute est disponible pendant une heure et expire ensuite automatiquement. Les moments sont rpartis de manire lgrement alatoire au cours de la journe, afin que les rponses ne soient pas toujours donnes au mme moment et au mme endroit.

Si tu manques une enqute, ce n''est pas un problme - tu peux simplement participer  l''heure suivante.', NULL, '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('eabb6592-f827-4887-93c2-67ea2b810fb7', 'household_members_financing', 'fr', 'Financement du budget', 'Combien de personnes dans ton mnage contribuent (y compris toi-mme) au revenu commun ?', '{"options": [{"label": "1 personne (seulement moi)", "value": "household_members_financing_1_person_myself_only"}, {"label": "2 personnes", "value": "household_members_financing_2"}, {"label": "3 personnes", "value": "household_members_financing_3"}, {"label": "4 personnes", "value": "household_members_financing_4"}, {"label": "5 personnes", "value": "household_members_financing_5"}, {"label": "6 personnes", "value": "household_members_financing_6"}, {"label": "7 personnes", "value": "household_members_financing_7"}, {"label": "8 personnes", "value": "household_members_financing_8"}, {"label": "9 personnes", "value": "household_members_financing_9"}, {"label": "10 ou plus", "value": "household_members_financing_10_or_more"}]}', '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('f7571525-bb1c-49da-8c12-16352f1c509e', 'disabilities', 'fr', 'Dgradations', 'Tu as un handicap physique ou psychique, une maladie chronique ou un autre problme de sant qui affecte ton quotidien ?', '{"options": [{"label": "Oui", "value": "disabilities_yes"}, {"label": "Non", "value": "disabilities_no"}]}', '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('180e9fe5-84f8-4594-9486-cdd0105b3426', 'consent', 'fr', 'Consentement  la participation', 'Avant de commencer l''enqute, nous te demandons ton accord pour participer  cette tude.

La participation est volontaire.  
Tu peux ignorer certaines questions (par exemple en rpondant "pas d''indication") et mettre fin  ta participation  tout moment.  
Dans les paramtres de l''application, tu peux aussi effacer compltement tes donnes ultrieurement.

## Quelles donnes sont collectes ?

- Donnes te concernant (par ex. ge, sexe, formation).
- Rponses sur ton tat actuel et ton lieu de sjour
- donnes de localisation, si tu en donnes l''autorisation

## Comment utilisons-nous tes donnes ?

- Nous n''enregistrons pas de noms, d''adresses e-mail ou d''autres donnes de contact personnelles.
- Tes donnes sont stockes de manire anonyme sur un serveur scuris de la socit Supabase en Suisse.
- Aucun profil de dplacement ou historique de localisation consultable en permanence n''est enregistr.
- Tes donnes sont utilises exclusivement  des fins scientifiques et ne sont pas transmises  des tiers.

En cliquant sur "J''accepte", tu confirmes que tu as lu et compris ces informations et que tu participes volontairement  l''tude. Tu peux mettre fin  ta participation  tout moment et supprimer tes donnes via les paramtres de l''application.

Tu trouveras plus d''informations dans notre [Politique de confidentialit](https://intermind.ch/privacy-policy.html).', NULL, '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('40e40e2c-2d94-4d8b-a4f0-8976f48dcd66', 'notifications', 'fr', 'Notifications', 'Pour que tu ne manques aucun entretien, nous t''envoyons des notifications.

Ces rappels arrivent automatiquement lorsqu''un nouveau crneau d''enqute dmarre. Tu as alors une heure pour rpondre.

Les notifications sont importantes parce que les crneaux horaires sont courts. Tu peux les dsactiver dans les paramtres de l''appareil - mais tu risques alors de manquer des enqutes.

Nous te recommandons d''autoriser les notifications pour que tu puisses saisir le plus de situations diffrentes possible.', NULL, '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('f9bb70b6-e1ee-4407-b752-498c5de1ba73', 'location_acces', 'fr', 'Site', 'Pour nous permettre de mieux comprendre les rponses et d''identifier les modles spatiaux, nous te demandons d''autoriser le partage de l''emplacement.

Nous pourrons ainsi voir, par exemple, si l''exprience vcue dans des lieux anims diffre de celle vcue dans des zones calmes - sans connatre ton nom ou tes adresses exactes.

La localisation nous aide donc  complter tes informations sur le lieu o tu te trouves, par exemple avec des informations sur les environs.

Tes donnes sont exclusivement enregistres de manire anonyme et ne sont pas suivies  long terme.

Tu peux  tout moment dsactiver le partage de la localisation dans les paramtres de ton appareil.', NULL, '2025-05-11 08:18:19.710817+00', '2025-05-11 08:18:19.710817+00'),
	('67dd43e2-0576-4608-a468-67d845004f55', 'info_questions_about_you', 'fr', 'Quelques questions  ton sujet', 'Avant de commencer les enqutes quotidiennes, nous te posons une fois quelques questions sur toi-mme - par exemple sur ton ge, ton sexe, ta formation et ta situation de vie.

